import NavItem from "./NavItem";

// const props = ['Home', 'Catalog', 'About', 'Contacts'];

export default function Navbar (){
    return(
        <nav-bar>
            <NavItem><a>Home</a></NavItem>
            <NavItem><a>Catalog</a></NavItem>
            <NavItem><a>About</a></NavItem>
            <NavItem><a>Contacts</a></NavItem>
        </nav-bar>
    );
}
